import React from 'react';

import Head from 'next/head';
import Meta from '../Meta';

import { Container } from './styles';

const Header: React.FC = () => {
  return (
    <>
      <Head>
        <title>Bem-vindo(a)!</title>
        <Meta />
      </Head>
      <Container>
        <h1>Hello, Header!</h1>
      </Container> 
    </>
  );
}

export default Header;
